626215adecc7ecb011173295a8e824b8bc29fe1e:
query ENSDomainQuery($name: String!) {
  domains(where: {name: $name}) {
    __typename
    id
    name
    labelName
    labelhash
    parent {
      id
      name
    }
    subdomains {
      id
      name
    }
    resolvedAddress {
      __typename
      id
    }
    owner {
      __typename
      id
    }
    resolver {
      __typename
      id
      domain {
        id
      }
      address
      addr {
        id
      }
      texts
      coinTypes
      events {
        id
        blockNumber
        transactionID
        __typename
      }
    }
    ttl
    isMigrated
    events {
      __typename
      id
      blockNumber
      transactionID
      ... on Transfer {
        owner {
          id
        }
        id
      }
      ... on NewOwner {
        owner {
          id
        }
        id
      }
      ... on NewResolver {
        resolver {
          id
          address
        }
        id
      }
      ... on NewTTL {
        ttl
        id
      }
      __typename
    }
  }
}

